import React, {useState, useEffect} from "react";
import ReactDOM, {render} from "react-dom/client";
import SongItem from "./components/songsLogic/SongItem";




function App(){
    const songs = [
        {id:0, title: 'song 2', artist: 'blur', album:'best of', duration:'2:22'},
        {id:1, title: 'crying in the rain', artist: 'avi bitter', album:'best of', duration:'3:22'},
        {id:2, title: 'white screen', artist: 'white screen', album:'test', duration:'5:21'}
    ];

    return (
        <div>

        <h1>songs</h1>
            <p>show this</p>
        <SongItem>
            title = {songs[0].title}
            artist = {songs[0].artist}
            album = {songs[0].album}
            duration = {songs[0].duration}
        </SongItem>
            <SongItem>
            title = {songs[1].title}
            artist = {songs[1].artist}
            album = {songs[1].album}
            duration = {songs[1].duration}
        </SongItem>
            <SongItem>
            title = {songs[2].title}
            artist = {songs[2].artist}
            album = {songs[2].album}
            duration = {songs[2].duration}
        </SongItem>
            </div>

    )
};
export default App;
